import React from 'react';
import Button from './Button';
import './Nabar.css';

function Navbar() {
  return (
    <div className="Navbar">
      <div className="left">
        <Button text="Zoo" />
      </div>
      <div className="right">
        <Button text="Home" />
        <Button text="Login" />
        {/* Add more buttons as needed */}
      </div>
    </div>
  );
}

export default Navbar;
